import React from 'react';
import MainLayout from '../../../layouts/MainLayout';

import {
  ApolloClient,
  ApolloProvider,
  gql,
  InMemoryCache,
} from '@apollo/client';

const client = new ApolloClient({
  uri: 'http://localhost:5000/graphql',
  cache: new InMemoryCache(),
});

export default function LaunchPage({ launch }) {
  console.log(launch);
  return (
    <MainLayout>
      <div>Launch</div>
    </MainLayout>
  );
}

export async function getServerSideProps(context) {
  const { store, query, req } = context;

  const { data, errors } = await client.query({
    query: gql`
      {
        launch(id: "5eb87cd9ffd86e000604b32a") {
          id
          flight_number
          name
          success
          details
          date_unix
        }
      }
    `,
  });

  return {
    props: { launch: data.launch }, // will be passed to the page component as props
  };
}
